  10,\n\t\"tags\": [],\n\t\"title\": \"Auroral Electrojet (AE, AL, AO, AU) - A Global
  Measure of Auroral Zone Magnetic Activity\",\n\t\"tracking_summary\": {\n\t\t\"total\":
